import React from 'react';
import './App.css';

class App extends React.Component{

constructor(props){
  super(props);
  this.userClicked=this.userClicked.bind(this);

}

userClicked(evt){
  console.log(evt);
}

render() {

  return (
    <div id='User'  className='User' data-item={this.props.user_id}>
     <div id='header'>
      <label id='name'>{this.props.name === '' ? 'No Name' : this.props.name}</label>
      <label id='prof'>{this.props.job}</label>
     </div>
     <div id='email'>
      <label>{this.props.email}</label>
     </div>
     <div id='body'>
     <label>Bio...</label>
     <div id='bio_div'>
     <p id='page'>{this.props.bio}</p>
     </div>
     </div>
      <button id="btn" onClick={userClicked(this.props.user_id)} >PATCH</button>
    </div>
  );

}

}

export default App;
